import styled from 'styled-components';
import { View } from 'react-native';

export const MainView = styled(View)`
  padding-top: 20px;
  display: flex;

  /* flex: 1; */
  background-color: 'green';
  align-items: 'center';
  justify-content: 'center';
  color: 'tomato';
`;
